import React from 'react';
import OutputStyle from '../../Css/Components/HomeComponent/Output.module.css';


const Output = () => {

	
	return (
		<div>
			<div className={`${OutputStyle.OutputFrame}`}>
				<p className={`${OutputStyle.OutputValue}`}>dfs</p>
			</div>

		</div>
	);

}

export default Output;
